const Select = () => {
  <div>
    <label htmlFor="select">Select an option:</label>
    <select id="select">
      <option value="">Choose an option</option>
      <option value="item1">Item 1</option>
      <option value="item2">Item 2</option>
      <option value="item3">Item 3</option>
    </select>
  </div>;
};

export default Select;
